import React from 'react';

export default function Card() {
    return (
        <div className='card'>
            <img src={'images/katie-zaferes.png'} alt='' />
            <div className='card-star'>
                <img src={'images/star.png'}/>
                <h4>5.0 (6)- USA</h4>
            </div>
            <h3>Life lesson with Katie Zaferes</h3>
            <p>From $136 / person</p>
        </div>
    )
}
